INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(1, 4, '2018-04-10 04:16:54', 'SMTP Pro was installed successfully.', 'SMTP Pro has been installed successfully. Go to the system configuration section of your Magento admin to configure SMTP Pro and get it up and running.', 'https://github.com/aschroder/Magento-SMTP-Pro-Email-Extension', 1, 0),
(2, 4, '0000-00-00 00:00:00', 'The extension JeroenVermeulen_Solarium has been installed - Setup Instructions', 'Please follow these steps:<br />&nbsp; &nbsp; &#8226; Flush Magento\'s Cache Storage<br />&nbsp; &nbsp; &#8226; Log out<br />&nbsp; &nbsp; &#8226; Log in<br />&nbsp; &nbsp; &#8226; Configure via:&nbsp;System &gt; Configuration &gt; CATALOG &gt; Solarium Search<br />', NULL, 1, 0),
(3, 1, '2018-02-27 19:45:55', 'Magento Open Source 1.9.3.8 and SUPEE-10570 Enhance Security and Functionality – 2/27/2018', 'Magento Open Source 1.9.3.8 and the SUPEE-10570 patch include critical security enhancements and feature updates, including support for recent USPS API changes. Review the release notes for more information: http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html ', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 1, 0),
(4, 1, '2018-04-09 05:03:15', 'Take Steps to Protect Your Site ', 'Our goal is to help you deliver the highest level of security to your Magento site. \n\nYou now have access to a security scan tool that enables you to regularly monitor your sites and receive updates regarding known security risks, malware, and unauthorized access. It provides over 30 security tests to identify potential vulnerabilities, such as missing Magento patches, configuration issues, and failure to follow security best practices. Please be sure to set your site up for security scanning – activation is quick and easy. Access today in your Magento account.\n\nYou should also visit our Security Center which provides alerts around potential issues as well as best practices to help you protect your site against issues, such as brute force attacks. Brute-force password guessing attacks continue to target Magento Open Source (formerly Community Edition) sites worldwide and we have published an  article that explains multiple actions you can take to protect your site from such attacks. In some cases, these attacks have resulted in unauthorized administrative access, so it is important to implement these recommendations.\n\nTo visit the Magento Security Center:\nwww.magento.com/security\n\nTo view steps you can take to protect against issues like brute force, go to:\nwww.magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks\n', 'https://magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks', 1, 0),
(5, 4, '2018-05-02 21:07:01', 'Magento Open Source 2.2.4 Enables Better Shopping Experiences with Integrated Payment, Tax, and Shipping Solutions – 5/2/2018', 'The latest release of Magento Open Source empowers merchants to create better shopping experiences with performance enhancements and integrations with Amazon Pay, Klarna, and Vertex. Learn how these features can help you reduce cart abandonment and increase average order value, while simplifying your operations at https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce', 'https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce', 1, 0),
(6, 1, '2018-06-27 18:45:16', 'Magento Open Source 2.2.5 delivers important security updates along with performance and functionality enhancements – 6/27/2018', 'The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.5-and-2.1.14-security-update', 'https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html', 1, 0),
(7, 4, '2018-07-16 23:55:59', 'Survey: Help us improve the Admin Panel usability by taking this 5 minute survey.', 'We\'d like to invite you to take our online survey on Admin Panel Usability. Your input is valuable to us and will help to inform the user experience direction. The survey should take no more than 5 minutes to complete.\n \nTo get started, go to:\nhttps://www.surveymonkey.com/r/SUS-AdHoc-M1 ', 'https://www.surveymonkey.com/r/SUS-AdHoc-M1 ', 1, 0);
