(1, 'Footer - Links', 'footer_links', '<div class=\"row\">\r\n<div class=\"col-xs-12 col-sm col-md col-lg\">\r\n<h5>Institucional</h5>\r\n<ul>\r\n<li><a href=\"{{store url=\'quem-somos\'}}\">Quem Somos</a></li>\r\n<li><a href=\"{{store url=\'politicas-de-privacidade\'}}\">Pol&iacute;ticas de Privacidade</a></li>\r\n<li><a href=\"{{store url=\'termos-de-uso\'}}\">Termos de uso</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"col-xs-12 col-sm col-md col-lg\">\r\n<h5>Minha conta</h5>\r\n<ul>\r\n<li><a href=\"{{store url=\'customer/account/\'}}\">Minha conta</a></li>\r\n<li><a href=\"{{store url=\'customer/account/forgotpassword\'}}\">Recuperar senha</a></li>\r\n<li><a href=\"{{store url=\'sales/order/history\'}}\">Meus pedidos</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"col-xs-12 col-sm col-md col-lg\">\r\n<h5>Ajuda?</h5>\r\n<ul>\r\n<li><a href=\"{{store url=\'contato\'}}\">Fale conosco</a></li>\r\n<li><a href=\"{{store url=\'duvidas-frequentes\'}}\">Dúvidas Frequentes</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"col-xs-12 col-sm col-md col-lg\">\r\n<h5>Extras</h5>\r\n<ul>\r\n<li><a href=\"{{store url=\'gwishlist/gwishlist\'}}\">Favoritos</a></li>\r\n<li class=\"hidden\"><a href=\"{{store url=\'sitemap/produtos\'}}\">Sitemap</a></li>\r\n</ul>\r\n</div>\r\n</div>', '2018-04-10 04:17:04', '2018-04-10 04:36:57', 1),
