(1, '404 - Página não encontrada', 'one_column', NULL, NULL, 'no-route', NULL, '<p><br /><br /><br /><br /></p>\r\n<div class=\"page-title center-xs\">\r\n<h1>Erro 404</h1>\r\n<h4 style=\"margin-top: 0; display: block; width: 100%;\">P&aacute;gina n&atilde;o encontrada</h4>\r\n</div>\r\n<p class=\"text-center\"><strong>A p&aacute;gina que voc&ecirc; solicitou n&atilde;o foi encontrada, veja um dos poss&iacute;veis motivos:</strong> <br /> - Se voc&ecirc; digitou o URL diretamente, verifique se a mesma est&aacute; correta. <br /> - Se voc&ecirc; clicou em um link para chegar aqui, ele pode estar desatualizado ou n&atilde;o existir mais.</p>\r\n<h5 class=\"text-center\">Como podemos ajudar?</h5>\r\n<p class=\"text-center\"><a href=\"{{store url=\'\'}}\">Voltar a Home</a> <span style=\"color: #aaa; padding: 10px;\">/</span> <a href=\"{{store url=\'customer/account\'}}\">Minha Conta</a></p>\r\n<p><br /><br /><br /></p>', '2018-04-10 04:17:04', '2018-04-10 04:39:08', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
